import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import {Dashboard} from "./components/dashboard/Dashboard"
import { BrowserRouter, Route, Switch } from 'react-router-dom';

ReactDOM.render(

  <React.StrictMode>
    <div className="wrapper">
      <div><h1 style={{"font-size": "2em"}}>Application</h1>
      </div>

      <BrowserRouter>
        <Switch>
          <Route path="/dash">
            <Dashboard />
          </Route>
          <Route path="/">
            <App />
          </Route>
        </Switch>
      </BrowserRouter>
    </div>
  </React.StrictMode>,
  document.getElementById('root')
);

